import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 338px;
  background: linear-gradient(
    270deg,
    #f09536 -1.13%,
    #f1b758 101.86%,
    #f09536 101.87%
  );
`;
